import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
//import './index.css';
//import reportWebVitals from './reportWebVitals';
import './App.css';
import Navbarmain from './Navbarmain';

class Ask extends Component{

    render() {
   
        return (
          <>
           <Navbarmain />
            <Container>
           
<Form>
      <Form.Group>
        <Form.Label>Title</Form.Label>
        <Form.Control type="text" placeholder="Enter title" />
        
      </Form.Group>
     
      <Form.Group>
      <Form.Label>Category</Form.Label>
      <Form.Control as="select" placeholder="Choose your option">
    <option selected disabled>Choose your option</option>
    <option>C/C++</option>
    <option>Java</option>
    <option>Python</option>
    <option>Javascript</option>
    <option>SQL</option>
    <option>Go</option>
    <option>React</option>
    <option>PHP</option>
    <option>Other</option>
  </Form.Control>
  </Form.Group>
      <Form.Group >
        <Form.Label >Description</Form.Label>
        <Form.Control id="bbox" type="text" placeholder="Enter your question here" />
      </Form.Group>
      <Form.Group>
        <Form.Check type="checkbox" label="I agree to Terms & Conditions" />
      </Form.Group>
      <Button variant="primary" type="submit">
        Ask!
      </Button>
    </Form>
    </Container>
</>
        );
    }
}
export default Ask;
